import React, {Component} from "react";
import ResumeComponent from "./ResumeComponent.jsx";
import GridContainer from "./../shared/grid/GridContainer.js";
import * as resumeList from "./../../constants/propObjectContainer.js";
import CardContainer from "./../shared/cards/CardContainer.js";

class ResumeContainer extends Component {
    render(){
        const cards = []

        const cardCreator = (
            Object.entries( resumeList.RESUME.TECHNICAL_EXPERIENCES ).map( content =>
                cards.push(
                    <CardContainer
                        header={content[1]}
                        raised={true}
                        onClick={() => null}
                        generateColor={true}
                    /> ) )
        )

        const props = {
            education: <GridContainer {...resumeList.RESUME.EDUCATION} />,
            experience: <GridContainer {...cards} displayPropertyName={false} />,
            objective: <GridContainer {...resumeList.RESUME.OBJECTIVE} displayPropertyName={false} />,
            qualification: <GridContainer {...resumeList.RESUME.SUMMARY_OF_QUALIFICATION} displayPropertyName={false} />,
            organizations: <GridContainer {...resumeList.RESUME.ON_CAMPUS_ORGANIZATIONS} displayPropertyName={false} />,
            experience: <GridContainer {...resumeList.RESUME.Ex} displayPropertyName={false} />
        };
       
    
        return <ResumeComponent {...props} />
    }
}

export default ResumeContainer;
